import React from "react";
import '../css/Footer.css';
function Footer(){
    return(
        <>
        <div>
            <footer>
                 <p>Codeado con amor por Cris Silva para Mi Portafolio 2024</p>
            </footer>
        </div>
          
        </>
    );
}

export default Footer;
